import { Fragment } from "react";
import { useParams } from "react-router";


const QuoteDetail = () => {
    const params = useParams();

    return (
        <Fragment>
            <h1>Quotes Detail</h1>
            <p>{params.quoteId}</p>
        </Fragment>
    )
};


export default QuoteDetail;
